console.log(mycontextOne);
class A extends React.Component{
  constructor(props) {
      super(props);
  }
  render () {
    return (
      <React.Fragment>
       <mycontextOne.Provider value={'111'}>
        <B	/>
       </mycontextOne.Provider>
      </React.Fragment>
      );
  }
}

export default A;
